Anyone else feeling like the warm weather is bringing them out of hibernation?

I’ve spent the majority of the past few months filming and editing mostly interview video for work. Being cooped up had made me sooo eager to get out and do what I enjoy most; to make videos with my friends. 

Last week @MazdaCanada gave me an excuse to do just that. We took the literal #RoadBackToNature and it took us to some cool places.

I really wanted to film a short video that captured some of that feeling. I took inspiration from Outer Banks, a show that’s kept me hyped for summer during the rainy season.

Mazda dropped off a 2021 CX-5 and we decided on canoeing. It turned out it wasn’t canoeing weather at all but something about being completely soaked is pretty fun!

Big thanks to @MazdaCanada for making this adventure happen and providing the vehicle to do so.

